script: |
  super -f text -I q4776.spq | sort > q4776.out

inputs:
  - name: q4776.spq
    data: |
      SELECT DISTINCT col0 / tab2.col0 + - col0 FROM tab2 (FORMAT parquet) WHERE NOT col2 + col1 BETWEEN + col0 + - col2 AND col2 * col1 * col1;
  - name: tab2

outputs:
  - name: q4776.out
    data: |
